import React from "react";
import "./loading.css";

export default function LoadingInicator(props) {
  const antIcon = (
    <Icon type="loading-3-quarters" style={{ fontSize: 30 }} spin />
  );
  return (
    <Spin
      indicator={antIcon}
      style={{ display: "block", textAlign: "center", marginTop: 30 }}
    />
  );
}
